import React from 'react'

function Search() {
  return render();
}

function render() {
    return (
        <div className='SearchPage'>
            <div className='header'><h2>SEARCH</h2></div>
            <div className='search-field'>
                <p>Search data:</p><input type='text'></input>
            </div>
        </div>
    )
}

export default Search
